import React from 'react'
import CancelIcon from '@material-ui/icons/Cancel';

function UploadLoveFramesData(props) {
    return (props.dataTrigger)?(
        <div className='popup'>
            <div className='popup-inner'>
                <CancelIcon 
                    className="close-btn" 
                    onClick={()=>{
                        props.setDataTrigger(false)
                    }}
                />
                
                <h3>LOVE PHOTO FRAMES</h3>
                <br/>
                <form className='form-box' >
                    <select onChange={props.categoryChange}>
                          <option>Select Option</option>
                                
                      {props.categories.map(props.MakeItem)}
                    </select>
                    <select >
                          <option>Select Option</option>

                      {props.bundles.map(props.MakeItem)}
                    </select>

                    <br/>
                    <br/>
                    Coordinates
                    <br/>
                    X:&nbsp;
                    <input type="text" value='' />
                    &nbsp;&nbsp;&nbsp;
                    Y:&nbsp;
                    <input type="text" value='' />
                    <br/>
                    <br/>
                    Position
                    <br/>
                    H:&nbsp;
                    <input type="text" value='' />
                    &nbsp;&nbsp;
                    W:&nbsp;
                    <input type="text" value='' />
                    <br/>
                    <br/>
                    <b>Upload Frame: </b>
                    <input type="file" required />
                    {/* <input type="file" multiple accept='image/*' onChange={this.onImagesChange} /> */}
                    <br/>
                    <input type="submit" value="Submit" />
                </form>
            </div>
        </div>
            
    ):"";
}

export default UploadLoveFramesData
